import "./header.css"
import headimg from "./image/headerimg.jp"

export default function Header() {
    return (
        <div className="header">
            <div className="headertitle">
                <span className="headertitlelg">Blog</span>
            </div>
            <img src="" alt=""></img>
        </div>
    )
}
